import React from 'react';
import { StyleSheet, Text, View } from 'react-native';

export default function App() {

  const mainImg = 'https://fontmeme.com/temporary/81750352183580c7a5e9d1f42b28f9d0.png';
  return (
    <View style={styles.container}>
      <img src='https://fontmeme.com/temporary/81750352183580c7a5e9d1f42b28f9d0.png'/>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
